import React, { useState } from "react";
import "./App.css";

const API_URL = "http://127.0.0.1:5000";

export default function App() {
  const [file, setFile] = useState(null);
  const [method, setMethod] = useState("AES");
  const [key, setKey] = useState("");
  const [loading, setLoading] = useState(false);
  const [decryptKey, setDecryptKey] = useState("");

  const handleEncrypt = async () => {
    if (!file) return alert("Please upload a file.");
    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);
    formData.append("method", method);

    try {
      const response = await fetch(`${API_URL}/encrypt`, {
        method: "POST",
        body: formData,
      });

      const result = await response.json();
      if (result.error) throw new Error(result.error);

      setKey(result.key);

      // trigger file download
      const downloadRes = await fetch(`${API_URL}/download/${result.filename}`);
      const blob = await downloadRes.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = result.filename;
      a.click();
    } catch (error) {
      alert("Encryption failed ‚Äî " + error.message);
    } finally {
      setLoading(false);
    }
  };

  const handleDecrypt = async () => {
    if (!file || !decryptKey) return alert("Please select file and key.");
    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);
    formData.append("key", decryptKey);
    formData.append("method", method);

    try {
      const response = await fetch(`${API_URL}/decrypt`, {
        method: "POST",
        body: formData,
      });

      if (!response.ok) throw new Error("Decryption failed");
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = "decrypted_" + file.name;
      a.click();
    } catch (error) {
      alert("Decryption failed ‚Äî " + error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="app-container">
      <h1 className="title">üîê SecureScan Encryption Suite</h1>
      <div className="card">
        <label className="file-label">
          Choose file:
          <input
            type="file"
            onChange={(e) => setFile(e.target.files[0])}
            className="file-input"
          />
        </label>

        <label className="method-label">
          Encryption Method:
          <select
            value={method}
            onChange={(e) => setMethod(e.target.value)}
            className="dropdown"
          >
            <option value="AES">AES</option>
            <option value="Fernet">Fernet</option>
            <option value="RSA">RSA</option>
          </select>
        </label>

        <div className="button-group">
          <button onClick={handleEncrypt} disabled={loading}>
            {loading ? "Encrypting..." : "Encrypt File"}
          </button>
          <button onClick={handleDecrypt} disabled={loading}>
            {loading ? "Decrypting..." : "Decrypt File"}
          </button>
        </div>

        {key && (
          <div className="key-box">
            <p>
              <strong>Generated Key:</strong>
            </p>
            <textarea value={key} readOnly rows={3}></textarea>
            <button
              onClick={() => navigator.clipboard.writeText(key)}
              className="copy-btn"
            >
              Copy Key
            </button>
          </div>
        )}

        <div className="key-input-section">
          <label>
            Decryption Key:
            <textarea
              rows={3}
              value={decryptKey}
              onChange={(e) => setDecryptKey(e.target.value)}
              placeholder="Paste your key here"
            />
          </label>
        </div>
      </div>
    </div>
  );
}
